import { MDBContainer, MDBIcon } from "mdbreact";
import "./suggestion.css"
import '@fortawesome/fontawesome-free/css/all.min.css';
import 'bootstrap-css-only/css/bootstrap.min.css';
import 'mdbreact/dist/css/mdb.css';
import { useState } from "react";
import Axios from 'axios';
import 'react-bootstrap-typeahead/css/Typeahead.css';
import Form from 'react-bootstrap/Form';
import * as React from 'react';
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import useMediaQuery from '@mui/material/useMediaQuery';
import { useTheme } from '@mui/material/styles';
import Swal from 'sweetalert2';

function AddSuggest() {
  const [searchinput, setSearchinput] = useState('');
  const [saveinput, setSaveinput] = useState([]);
  const [result, setResult] = useState([]);
  const [sresult, setsResult] = useState('');
  //var index = 0;
  const [index, setIndex] = useState(0);

  const [formData, setFormData] = useState({
    dname: '',
    age: '',
    sex: '',
    pregnancy: '',
    lactation: '',
    disease: '',
    kidney: '',
    weight: '',
    severity: '',
  });
  const [rows, setRows] = useState([
    { id: 1, col1: '', col2: '', col3: '' },
  ]);
  const [nextId, setNextId] = useState(2);

  const handleAddRow = () => {
    setRows([...rows, { id: nextId, col1: '', col2: '', col3: '' }]);
    setNextId(nextId + 1);
  };

  const handleDeleteRow = (id) => {
    setRows(rows.filter((row) => row.id !== id));
  };

  const handleRowChange = (id, field, value) => {
    setRows(
      rows.map((row) => (row.id === id ? { ...row, [field]: value } : row))
    );
  };


  const [open, setOpen] = React.useState(false);
  const [fullWidth, setFullWidth] = React.useState(true);
  const theme = useTheme();
  const fullScreen = useMediaQuery(theme.breakpoints.down('md'));
  const [inputValue, setInputValue] = useState('');
  const [suggestions, setSuggestions] = useState([]);
  const data = [
    'Developer',
    'Engineer',
    'Data Scientist',
    'Data Engineer',
    'Mobile App Developer'
  ];
  const handleInputChange = (input) => {
    setInputValue(input);

    const filteredSuggestions = data.filter(
      data => data.toLowerCase().startsWith(input.toLowerCase())
    );

    setSuggestions(filteredSuggestions);
  }

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };



  const handleSubmit = (event) => {
    event.preventDefault(); // prevent default form submission
    console.log(formData); // display form data in console
    console.log(formData.dname.length);
    //check sex
    if(formData.sex == 'male'){
      setFormData({ ...formData, pregnancy: false }); // update form data
      setFormData({ ...formData, lactation: false }); // update form data
    }
    // handle form submission logic here
    //findSuggestion();
  }




  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData({ ...formData, [name]: value }); // update form data
  }
  const handleChangeSeverity = (event) => {
    const { value } = event.target;
    if (/^\d*$/.test(value)) {
      setFormData({ ...formData, age: value });
    }
  };

  const handleCheck = (event) => {
    //setIsChecked(event.target.checked);
    //console.log("check");
    //console.log(event.target.checked);
    //console.log(event.target.name);

    //const { name, value } = event.target.checked;
    setFormData({ ...formData, [event.target.name]: event.target.checked });
    // handle checkbox form logic here
  }











  function findSuggestion() {
    console.log("active");
    Axios.post('http://localhost:3001/drugdisease', {
      'dname': formData.dname,
      'age': formData.age,
      'sex': formData.sex,
      'pregnancy': formData.pregnancy,
      'lactation': formData.lactation,
      'disease': formData.disease,
      'kidney': formData.kidney,
      'weight': formData.weight,
    }).then((respond) => {
      console.log(respond.data);
      setsResult(respond.data);
    }).catch((error) => {
      console.error(error);
    });
  }





  //console.log(saveinput);
  //findInteraction("Abacavir","Aceclofenac");


  //test();
  //test2("Abacavir","Aceclofenac");

  return (
    <MDBContainer>
      <div>
        <br /><h1 className="text-center">Add Suggestion</h1><br />
      </div>
      <div>
      <Typeahead id="autocomplete-input" labelKey="name" placeholder="Search" options={data} onChange={setInputValue} onInputChange={handleInputChange} selected={inputValue ? [inputValue] : []} />
      </div>


      <div>
      <table className="table">
        <thead>
          <tr>
            <th>Factor</th>
            <th>Operator</th>
            <th>Value</th>
            <th></th>
          </tr>
        </thead>
        <tbody>
          {rows.map((row) => (
            <tr key={row.id}>
              <td>
                <Form.Select
                  value={row.col1}
                  onChange={(event) =>
                    handleRowChange(row.id, 'col1', event.target.value)
                  }
                >
                  <option value=""></option>
                  <option value="age">Age</option>
                  <option value="weight">Weight</option>
                  <option value="sex">Sex</option>
                  <option value="pregnancy">Pregnancy</option>
                  <option value="lactation ">Lactation</option>
                  <option value="disease">Underlying disease</option>
                  <option value="kidney">Kidney function</option>
                </Form.Select>
              </td>
              <td>
                <Form.Select
                  value={row.col2}
                  onChange={(event) =>
                    handleRowChange(row.id, 'col2', event.target.value)
                  }
                >
                  <option value=""></option>
                  <option value="equal">Equal</option>
                  <option value="notEqual">Notequal</option>
                  <option value="lessThan">Lessthan</option>
                  <option value="greaterThan">Greaterthan</option>
                  <option value="lessThanInclusive">Lessthan or Equal</option>
                  <option value="greaterThanInclusive">Greaterthan or Equal</option>
                  <option value="in">In</option>
                </Form.Select>
              </td>
              <td>
                <Form.Control
                  type="text"
                  value={row.col3}
                  onChange={(event) =>
                    handleRowChange(row.id, 'col3', event.target.value)
                  }
                />
              </td>
              <td>
                <button
                  type="button"
                  className="btn btn-danger"
                  onClick={() => handleDeleteRow(row.id)}
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <button type="button" className="btn btn-primary" onClick={handleAddRow}>
        Add Row
      </button>
    </div>


    </MDBContainer>
  );
}

export default AddSuggest;
